import React from "react";
import { useSelector } from "react-redux";
import ProjectsPresenter from "./ProjectsPresenter";
import { RootReducerType } from "../../reducers/rootReducer";

interface cards {
	projectCards: Array<{
		id: string;
		category: string;
		content: string;
		tags: Array<string>;
	}>;
}

const ProjectContainer: React.VFC = () => {
	const cardData: cards = useSelector(
		(state: RootReducerType) => state.cardReducer
	);
	console.log(cardData.projectCards);

	return <ProjectsPresenter cards={cardData.projectCards} />;
};

export default ProjectContainer;
